// SelectedEventList.js

import React from 'react';

const SelectedEventList = ({ selectedEvents, onDeselect }) => {
  return (
    <div className="selected-event-list">
      <h2>Selected Events</h2>
      {selectedEvents.map(event => (
        <div key={event.id} className="selected-event-card">
          <div><strong>Name:</strong> {event.event_name}</div>
          <div><strong>Category:</strong> {event.event_category}</div>
          <div><strong>Timings:</strong> {event.start_time} - {event.end_time}</div>
          <button onClick={() => onDeselect(event)}>Deselect</button>
        </div>
      ))}
    </div>
  );
};

export default SelectedEventList;
